import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import "../styles/admin.css";

const AddTour = () => {
  const [tours, setTours] = useState([]);
  const [photo, setPhoto] = useState('');
  const [name, setName] = useState('');
  const [price, setPrice] = useState('');
  const [location, setLocation] = useState('');
  const [scheduleId, setScheduleId] = useState('');
  const [description, setDescription] = useState('');
  const [quantity, setQuantity] = useState('');
  const [coachId, setCoachId] = useState('');
  const [numberOfPeopleOnTheTour, setNumberOfPeopleOnTheTour] = useState('');
  const [cateId, setCateId] = useState('');
  const [acId, setAcId] = useState('');

  const navigate = useNavigate();

  useEffect(() => {
    const fetchTours = async () => {
      try {
        const response = await axios.get('http://localhost:3000/tours');
        setTours(response.data.tours);
      } catch (error) {
        console.error('Error fetching tours:', error);
      }
    };

    fetchTours();
  }, []);

  const createTour = async (e) => {
    e.preventDefault();
    try {
      const newTour = {
        photo,
        name,
        price,
        location,
        schedule_id: scheduleId,
        description,
        quantity,
        coach_id: coachId,
        number_of_people_on_the_tour: numberOfPeopleOnTheTour,
        cate_id: cateId,
        ac_id: acId
      };
      await axios.post('http://localhost:3000/tours', newTour);
      // Refresh the list of tours
      const response = await axios.get('http://localhost:3000/tours');
      setTours(response.data.tours);
    } catch (error) {
      console.error('Error creating tour:', error);
    }
  };

  return (
    <div className="admin-container">
      <h1>Create Tour</h1>
      <form onSubmit={createTour} className="admin-form">
        <input type="text" placeholder="Photo URL" value={photo} onChange={(e) => setPhoto(e.target.value)} required />
        <input type="text" placeholder="Name" value={name} onChange={(e) => setName(e.target.value)} required />
        <input type="number" placeholder="Price" value={price} onChange={(e) => setPrice(e.target.value)} required />
        <input type="text" placeholder="Location" value={location} onChange={(e) => setLocation(e.target.value)} required />
        
        <div className="input-with-button">
          <input type="text" placeholder="Schedule ID" value={scheduleId} onChange={(e) => setScheduleId(e.target.value)} required />
          <button type="button" onClick={() => navigate('/add-schedule')}>Add Schedule</button>
        </div>
        
        <textarea placeholder="Description" value={description} onChange={(e) => setDescription(e.target.value)} required></textarea>
        <input type="number" placeholder="Quantity" value={quantity} onChange={(e) => setQuantity(e.target.value)} required />
        
        <div className="input-with-button">
          <input type="text" placeholder="Coach ID" value={coachId} onChange={(e) => setCoachId(e.target.value)} required />
          <button type="button" onClick={() => navigate('/add-coach')}>Add Coach</button>
        </div>
        
        <input type="number" placeholder="Number Of People On The Tour" value={numberOfPeopleOnTheTour} onChange={(e) => setNumberOfPeopleOnTheTour(e.target.value)} required />
        
        <div className="input-with-button">
          <input type="text" placeholder="Category ID" value={cateId} onChange={(e) => setCateId(e.target.value)} required />
          <button type="button" onClick={() => navigate('/add-category')}>Add Category</button>
        </div>
        
        <div className="input-with-button">
          <input type="text" placeholder="Accommodation ID" value={acId} onChange={(e) => setAcId(e.target.value)} required />
          <button type="button" onClick={() => navigate('/add-activity')}>Add Activity</button>
        </div>
        
        <button type="submit">Create Tour</button>
      </form>
      <div className="tours-grid">
        {tours.map((tour) => (
          <div className="tour-card" key={tour.Pro_id}>
            <img src={tour.Photo} alt={tour.Name} />
            <div className="tour-info">
              <h3>{tour.Name}</h3>
              <p>{tour.Location}</p>
              <p>${tour.Price} /per person</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AddTour;
